import React from "react";
import "./main.css";

const SericesBox = (props) => {
  const style_name = props.styleName;
  return (
    <div className="box">
        <i className={`fas ${style_name}`}></i>
        <h3>{props.place}</h3>
        <p>{props.data}</p>
    </div>
  );
};

export default SericesBox;
